add_action('wp_ajax_toggle_category', function()
{
    $cat_id = get_cat_id($_REQUEST['category']);

    $categories = wp_get_post_categories($post_id);
    $index = array_search($cat_id, $categories);
    if ($_REQUEST['value']) {
        if ($index === false)
            $categories[] = $cat_id;
    } else {
        if ($index !== false)
            unset($categories[$index]);
    }
    wp_set_post_categories($post_id, $categories);
    die('1');
});

